import React from 'react';

function App() {
  return (
    <div style={{ 
      padding: '20px', 
      textAlign: 'center',
      minHeight: '100vh',
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'center',
      alignItems: 'center'
    }}>
      <h1 style={{ 
        fontSize: '3rem', 
        color: '#1f2937',
        marginBottom: '1rem' 
      }}>
        ?? Health App
      </h1>
      <p style={{ 
        fontSize: '1.2rem', 
        color: '#6b7280' 
      }}>
        React is working! ??
      </p>
      <p style={{ 
        fontSize: '1rem', 
        color: '#9ca3af',
        marginTop: '1rem'
      }}>
        Next: We'll add the macro tracker functionality
      </p>
    </div>
  );
}

export default App;
